import React from 'react'

export default function Movie(props) {
  return (
    <div>
      <img 
        src='' 
        alt={props.title} 
      />
      <div>
        <h2>{props.title}</h2>
        <h3>{props.overview}</h3>
        <span></span>
      </div>
    </div>
  )
}
